from collections import defaultdict, Counter

# Recursive unwrap helper

def unwrap(obj):
    # If string, try to json loads
    if isinstance(obj, str):
        try:
            obj2 = json.loads(obj)
            return unwrap(obj2)
        except Exception:
            return obj
    if isinstance(obj, dict):
        # If it has 'sheets', we reached API payload
        if 'sheets' in obj and isinstance(obj['sheets'], list):
            return obj
        # If it has 'text', unwrap that
        if 'text' in obj:
            return unwrap(obj['text'])
    return obj

path = "/workspace/dumps/workspace/.overlong_tool_outputs/4sx9FooRpR6NAwV4pkquia.json"
