        return None
    return cell.get('formattedValue')

# Header
header = [fval(c) for c in rowData[0].get('values', [])]
col_map = {name:i for i,name in enumerate(header) if name}
needed = ['Date','Visitor','Home']
for n in needed:
    if n not in col_map:
        raise SystemExit(f'Missing {n}')
cd, cv, ch = (col_map['Date'], col_map['Visitor'], col_map['Home'])

team_games = defaultdict(list)
import datetime as dt

for r in rowData[1:]:
    vals = r.get('values', [])
    if not vals:
        continue
    ds = fval(vals[cd]) if cd < len(vals) else None
    vs = fval(vals[cv]) if cv < len(vals) else None
    hs = fval(vals[ch]) if ch < len(vals) else None
    if not ds or not vs or not hs:
        continue
    try:
        d = dt.datetime.strptime(ds, '%Y-%m-%d').date()
    except Exception:
        continue
    team_games[vs].append((d,'A'))
    team_games[hs].append((d,'H'))

# Compress multiple games same date to single occurence per team-location? Generally not needed; but if team had multiple on same date, it would mess next-day pair; handle by unique locations per date and pick both? We'll sort and consider per date unique sequence order H before A to be deterministic.

results = []
for team, games in team_games.items():
    # group by date and make deterministic order by location
    by_date = defaultdict(list)
    for d,l in games:
        by_date[d].append(l)
    seq = []
    for d in sorted(by_date.keys()):
        locs = sorted(by_date[d])  # 'A'<'H'
        # If multiple entries same date (shouldn't happen), reduce to one marker 'A' and/or 'H'; if both appear (impossible in NHL), record both as separate same-day games
        # For back-to-back computation, same-day duplicates shouldn't create next-day edges more than once. We'll take just first location arbitrarily.
        # But safer: if multiple, we still treat as one occurrence; choose 'H' if present else 'A'.
        if 'H' in locs:
            loc = 'H'
        else:
            loc = 'A'
        seq.append((d,loc))
    counts = Counter({'HA':0,'AH':0,'HH':0,'AA':0})
    for (d1,l1),(d2,l2) in zip(seq, seq[1:]):
        if (d2 - d1).days == 1:
            counts[l1+l2] += 1
    total = sum(counts.values())
    results.append((team, counts['HA'], counts['AH'], counts['HH'], counts['AA'], total))

# Sort by team
results.sort(key=lambda x: x[0])
print(len(results))
print(results[:10])
